class Dwarf {
    constructor() {
        this.isWorking = false;
    }
    getIsWorking() {
        return this.isWorking
    }
    setIsWorking(boolean) {
        this.isWorking = boolean
    }
    prepareGift(gift) {
        return new Promise((resolve, reject) => {
            setTimeout(() => {
                this.isWorking = false
                resolve("ok")
            }, (gift.preparation_time * 1000))
        })
    }
    addGift(sled, gift) {
        sled.gifts.push(gift)
    }
}
